{"1": {"comment_id": "looplondonloves"  "comment_text": "I love the new apricot shades of Woolfolk that have just come into the shop. I’m crazy about them on their own  but also held with the deep greens  slate blues  and aubergine of TYND. Those colours combined with the peachy orangey-pinks  well I just love those kinds of colours together. Seen here in TYND  the Ovis 21 Merino that’s like cashmere. Totally dreamy to knit with and wear.
@woolfolk_yarn has many patterns that use TYND  if you need some ideas. The Viljanen Shawlette by @meijuknits is beautiful knit with 2 skeins of this. 🍑

A little shoutout to @oranjehouse whose kindness to me in Philadelphia during the past difficult week  I will never forget. 🥲

#woolfolk #woolfolkyarn #looplondon #colours #color #knit #knitlife #knitting #crochet #knittersofinstagram #knittersoftheworld #apricot #onmyneedles #tynd #love #lifeinaknittingshop #inspiration #textiles #stitch"}  "2": {"comment_id": "looplondonloves"  "comment_text": "So very sorry for your loss. Keeping you in my thoughts and prayers ❤️"}  "3": {"comment_id": "jstepura"  "comment_text": "@jstepura Thank you so much. x x"}  "4": {"comment_id": "looplondonloves"  "comment_text": "Lovely!🧡🧡🧡🥰"}  "5": {"comment_id": "umbuddy1"  "comment_text": "Beautiful Susan! Will pop in soon and hopefully say hello ❤️"}  "6": {"comment_id": "jessiechorley"  "comment_text": "😍"}  "7": {"comment_id": "meijuknits"  "comment_text": "Gorgeous palette"}  "8": {"comment_id": "florence_spurling_studio"  "comment_text": "@florence_spurling_studio Thank you Florence! x"}  "9": {"comment_id": "looplondonloves"  "comment_text": "Beyond Gorgeous 🧡"}}

